import React from 'react';
import { useNavigate } from 'react-router-dom';
import Book from '../../Components/Book';
import '../Page.css';
import { useTypedSelector } from '../../hooks/useTypedSelector';
import { useAction } from '../../hooks/useAction';
import Counter from '../../Components/Counter';

function Third() {
  const navigate = useNavigate();
  const { countDays } = useTypedSelector((state) => state.PariState);
  const { setCountDays } = useAction();

  return (
    <div className="container">
      <button onClick={() => navigate(-1)}>back</button>

      <Book />
      <div className="question">
        <p>How many days will it take you ?</p>
        <Counter count={countDays} setCount={setCountDays} />
      </div>

      <button onClick={() => navigate('/fourth')}>next</button>
    </div>
  );
}

export default Third;
